import React, { useState, useEffect } from 'react';

const Subscriptions = () => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    store: '',
  });

  const [errors, setErrors] = useState({
    name: '',
    phone: '',
    email: '',
    store: '',
  });

  const [storeNames, setStoreNames] = useState([]);

  useEffect(() => {
    // Fetch store names from the JSON file (assuming it's in the src folder)
    fetch('.././db.json')
      .then((response) => response.json())
      .then((data) => {
        const locations = data.locations;
        const allLocations = Object.keys(locations).reduce(
          (acc, city) => [...acc, ...locations[city]],
          []
        );
        const names = allLocations.map((location) => location.name);
        setStoreNames(names);
      })
      .catch((error) => console.error('Error fetching store names:', error));
  }, []);

  const validateForm = () => {
    let isValid = true;
    const newErrors = { name: '', phone: '', email: '', store: '' };

    // Custom validation logic
    if (formData.name.trim() === '') {
      newErrors.name = 'Name is required';
      isValid = false;
    }

    if (!/^\d{10}$/.test(formData.phone)) {
      newErrors.phone = 'Please enter a valid 10-digit phone number';
      isValid = false;
    }

    if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = 'Please enter a valid email address';
      isValid = false;
    }

    if (formData.store.trim() === '') {
      newErrors.store = 'Please select a store';
      isValid = false;
    }

    setErrors(newErrors);
    return isValid;
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (validateForm()) {
      // Form is valid, you can submit the data or perform further actions
      console.log('Form submitted:', formData);
    } else {
      // Form is invalid, you can handle errors or display messages
      console.log('Form validation failed');
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  return (
    <div className="subscriptions-page">
      <h1>Coffee News Subscription</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" value={formData.name} onChange={handleChange} />
          <span className="error">{errors.name}</span>
        </div>
        <div>
          <label htmlFor="phone">Phone:</label>
          <input type="tel" id="phone" name="phone" value={formData.phone} onChange={handleChange} />
          <span className="error">{errors.phone}</span>
        </div>
        <div>
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} />
          <span className="error">{errors.email}</span>
        </div>
        <div>
          <label htmlFor="store">Select Your Store:</label>
          <select id="store" name="store" value={formData.store} onChange={handleChange}>
            <option value="">Select a store</option>
            {storeNames.map((name) => (
              <option key={name} value={name}>
                {name}
              </option>
            ))}
          </select>
          <span className="error">{errors.store}</span>
        </div>
        <button type="submit">Subscribe</button>
      </form>
    </div>
  );
};

export default Subscriptions;
